import React, { useState } from 'react';

export const LoginPage = ({ handleSubmit }) => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  // const handleSubmit = async (e) => {
  //   e.preventDefault();
  //   try{
  //     const response=await fetch("/login",{
  //       method: 'POST',
  //       headers: {
  //         'Content-Type':'application/json'
  //       },
  //     body:JSON.stringify({username,password})
  //     })
  //   }
  // };

  return (
    <div style={{ padding: '20px', backgroundColor: '#f0f0f0', borderRadius: '5px' }}>
      <h2 style={{ color: '#007bff', marginBottom: '20px', textAlign: 'center' }}>Login Page</h2>
      <form onSubmit={handleSubmit}>
        <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
          <label style={{ color: '#333', marginBottom: '10px' }}>Username:</label>
          <input
            type="text"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            style={{ padding: '5px', borderRadius: '3px', border: '1px solid #ccc', marginBottom: '20px', width: '300px', textAlign: 'center' }}
          />
        </div>
        <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
          <label style={{ color: '#333', marginBottom: '10px' }}>Password:</label>
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            style={{ padding: '5px', borderRadius: '3px', border: '1px solid #ccc', marginBottom: '20px', width: '300px', textAlign: 'center' }}
          />
        </div>
        <button type="submit" style={{ padding: '8px 20px', backgroundColor: '#007bff', color: '#fff', border: 'none', borderRadius: '3px', cursor: 'pointer' }}>Login</button>
      </form>
    </div>
  );
};


export default LoginPage;
